response.about:
"Опыт работы юристом более 20 лет, из них 5 лет на руководящих позициях;
• 5 лет опыта юридического сопровождения международных проектов;
• Более 10 лет Судебной практики в судах различных инстанций (Арбитражные  суды  и Суды общей юрисдикции, включая споры о взыскании задолженности по обязательствам, договорам цессии, обжалование актов государственных органов, сопровождение банкротства: возбуждение дела о банкротстве, включение в реестр кредиторов, участие в собраниях кредиторов, взаимодействие с арбитражными управляющими, а также другие виды споров).
• Опыт успешного взаимодействия с государственными органами, банками, судами, судебными приставами, нотариусами;
•  Опыт участия в плановых и внеплановых проверках со стороны органов государственного контроля (надзора) и муниципальных органов;
• Опыт сопровождения купли-продажи бизнеса и объектов недвижимости;
• Опыт ведения переговоров и досудебного урегулирования сложных вопросов;
• Практическое применение письменного английского языка, включая юридической и бизнес терминологии;
• Опыт самостоятельного сопровождения и участия в проектах в области авиационного бизнеса, строительства специализированных зданий, банковской деятельности, информационных технологий, таможенного оформления, в том числе построения корпоративной структуры зарубежных и российских холдинговых компаний (оценка правовых и налоговых рисков, согласование параметров сделок и подготовка документов по приобретению и продаже активов компаний, подготовка технических заданий, взаимодействие с внешними консультантами);
• Опыт юридического сопровождения различных проектов, в том числе успешное завершение более 500 проектов в области корпоративного, гражданского, трудового, административного, финансового, таможенного, международного и налогового права."
